function nParentElement(element) {
    let whileCon = false;

    do
    {
        let isCarrousselElement = element.className.includes('andes-carousel-snapped__slide');
        let isCardElement = element.className.includes('andes-card');

        if(isCarrousselElement || isCardElement)
        {
            whileCon = true;
        }
        else
        {
            element = element.parentElement;
        }
    }
    while(!whileCon)

    return element;
}

function dolaront() {
    var arrayPublicaciones = Array.prototype.slice.call(document.getElementsByClassName("andes-money-amount__currency-symbol"));
    arrayPublicaciones.forEach(x => x.innerHTML.toString() != "$" ? nParentElement(x).remove() : console.log("noseborro"));

    let clean1 = document.querySelector("#root-app > div > div.ui-search-main.ui-search-main--without-header.ui-search-main--only-products > section > ol");
    if(clean1 != null) { clean1.childNodes.forEach(y => y.firstChild.childElementCount == 0 ? y.remove() : null); }

    let clean2 = document.querySelectorAll("div.andes-carousel-snapped__controls-wrapper > div > div")[1];
    if(clean2 != null) { clean2.childNodes.forEach(y => y.childElementCount == 0 ? y.remove() : null); }
}

var intervalo = setInterval(dolaront,2000);